window.bookSummaryJSON = "<p>My worst fear has to come to pass, and now Stephan knows about my terrible secret. He hates me with every fiber of his being, and I can't blame him for it.</p> <p>Unfortunately, war has come, and we have to put our issues aside to fight the greatest evil that has befallen our world.</p> <p>Chaos will stop at nothing until he has destroyed everything we hold dear.</p> <p>Can Stephan and I work together without tearing each other apart, or will the end of the world mend what I thought was irreparable damage?</p> <p>Contains mature themes.</p>"; 
